import axios from 'axios';

// 直接返回对象
export const logIn = () => ({
  type: 'log'
})

const changeLoginState = (id) => ({
  type: 'change_log_state',
  id: id
})

export const getList = () => {
  return (dispatch) => {
    axios.get('/api/headerList.json').then((res) =>{
      const data = res.data;
      console.log(data.id)
      dispatch(changeLoginState(data.id))
    }).catch(() => {
      console.log('error');
    })
  }
}
